INSERT INTO `block_custom` VALUES (1,'<div class=\"sidebar-hunts-1\">\r\n<h4>Archery Elk</h4>\r\n<a href=\"hunts/gallery/archery-elk\"><img src=\"sites/all/themes/redwing_subtheme/images/elk.jpg\"></a>\r\n</div>\r\n<div class=\"sidebar-hunts-2\">\r\n<h4>Rifle Elk</h4>\r\n<a href=\"hunts/gallery/rifle-elk\"><img src=\"sites/all/themes/redwing_subtheme/images/rifle-elk.jpg\"></a>\r\n</div>\r\n<div class=\"sidebar-hunts-3\">\r\n<h4>Mule Deer</h4>\r\n<a href=\"hunts/gallery/mule-deer\"><img src=\"sites/all/themes/redwing_subtheme/images/mule-deer.jpg\"></a>\r\n</div>\r\n<div class=\"sidebar-hunts-4\">\r\n<h4>Aoudad</h4>\r\n<a href=\"hunts/gallery/aoudad\"><img src=\"sites/all/themes/redwing_subtheme/images/aoudad.jpg\"></a>\r\n<div class=\"sidebar-hunts-5\">\r\n<h4>Special Hunts</h4>\r\n<a href=\"hunts/special\"><img src=\"sites/all/themes/redwing_subtheme/images/special.jpg\"></a>\r\n</div>','Hunt Images Sidebar','full_html'),(2,'<div class=\"well\">\r\n<h2>About Us</h2>\r\n<p>We have been guiding and outfitting hunters full time since 1986.  Our New Mexico Lic # is 21, and Colorado LIc # is 815.   We are a family operation that specializes in  Western big game.  We have some of the best land  in the west specifically managed for trophy game.  Since we have been in business our success runs over 95% on all rifle hunts and 70% on archery.  For the last 25 years our clients have come strictly by word of mouth. In our camps you will find a , Christian atmosphere, fun hardworking professional guides, and real homecooking.  We have hunts for almost any budget and you don\'t have to be a fitness freak to kill game.  Come hunt while you still can!    Bob and Jennafer Daugherty.</p>\r\n</div>','About Us','full_html'),(3,'<div class=\"navbar-default\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-2 footer-left\">\r\n\r\n</div>\r\n<div class=\"col-sm-8 footer-mid\">\r\n    <div><p>\r\n&copy; 2014 Redwing Hunts. Site Developed by <a href=\"https://plus.google.com/u/0/111258713398685376322/posts\">Chris Wright</a>.</p>\r\n  </div>\r\n</div>\r\n\r\n\r\n</div>\r\n</div>\r\n</div>','Footer','full_html'),(4,'<p>Updates on Elk hunting coming soon!</p>\r\n<p></p>','Archery Elk Hunts Block','php_code'),(5,'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus id semper velit. Ut dignissim eget tellus sit amet rhoncus. Phasellus id lacus egestas, vehicula arcu a, pretium erat. Donec rutrum massa quis luctus imperdiet. Fusce scelerisque ante ac metus faucibus, vitae cursus odio aliquam. Maecenas interdum massa nec diam sagittis vehicula. Pellentesque posuere erat mattis enim dignissim cursus. Suspendisse lacinia ligula non metus dictum, eu semper magna viverra. Ut sagittis faucibus adipiscing. Maecenas porta, tortor non fringilla porta, enim quam ullamcorper nunc, et aliquam velit velit id diam. Fusce augue nisi, dictum ut enim eu, dictum tincidunt nisl. Cras vitae magna faucibus, tempus urna ultricies, tincidunt justo. Fusce lacus enim, dapibus vel velit nec, tincidunt fringilla dolor. Nullam pulvinar nisl sit amet ligula pulvinar consequat. Sed tempus ligula sit amet enim mattis, congue lobortis leo dapibus.\r\n','Rifle Elk Hunts Block','php_code'),(6,'If you haven\'t been on a true free-roaming Aoudad sheep hunt you are missing out on one of the most challenging and exciting hunts in the West.  These big rams are and incredible trophy and where they roam is breath-taking country.  We have one of the best ranches in the remotest area of West Texas.  We stay in a comfortable ranch house and use atv\'s and foot to go after these sheep.  Success has been better than 95%.  You can also combine this hunt with a desert mule deer and a javelina.  These hunts are done from Nov-March.','Aoudad Hunts Block','php_code'),(7,'<p>Most of the mule deer are taken in combination with an elk hunt .  This  is a great opportunity to take a buck with a bow as these deer are not very wild  due to the light hunting pressure  As the pictures prove we are killing some great bucks.</p>\r\n<p>For the hunter looking for a really western mule deer hunt we offer hunts out of our HI-7 ranch  where we live in SW New Mexico.  This hunt  is in some of the most beautiful big rough mountain country in the state.  Hunting is by foot out of our ranch house.  We take a couple of hunters each year and success has been 100%.</p>','Mule Deer Hunts Block','php_code'),(8,'<p>Let me know if you have a group and I can put together a good private ranch hunt.  This is usually second half of August.   Success runs 100%</p>','Antelope Hunts Block','filtered_html'),(9,'<p>These are spot and stalk hunts on our HI-7 ranch.  We will hike and glass and watch feeding areas until a bear is spotted. We will be staying in our ranch house and  hunting by atv and foot.  Success has been 100%.</p>','Bear Hunts Block','filtered_html'),(10,'<p>We live only two hours from where the Oryx live on White SandsMissileRange  and the Ibex on the Florida mountains.  We can fully guide and outfit for each one</p>','Exotic Hunts Block','filtered_html'),(11,'<p>These hunts are on our HI-7 ranch in SW New Mexico.  You will be hunting big rough rocky country.  We usually carry a day pack and spend all day hiking and glassing.  This is a challenging hunt with great potential.  We take 1-2  hunters per year and success has been 100%.</p>','Coues Deer hunts','filtered_html'),(12,'<p>We take 2-3 hunters per year on our friends ranch in South Texas.  This could be one of our best all around hunt packages.  We are calling gobblers early in the morning.  The remainder of the day can be filled with hog hunting and rattlesnake hunting or you can grab a fishing pole and head to the pond and  catch a big bass.  If you are still up for some more action we jump in a electric buggy with a spotlight and go night hunting for hogs.  This hunt is done around the first part of April.</p>','Turkey Hunt','filtered_html'),(13,'<p>If you need a true desert mule deer we have a great opportunity to get you a good one.  We have a peak rut hunt on our Aoudad ranch in Dec - Jan.  This hunt will require lots of hiking and glassing and a  Aoudad and Javelina can be added on the hunt.</p>','Desert Mule Deer Hunts','filtered_html');
